import styled from 'styled-components';

export const LoginComponent = () => {

    return (
        <LoginPanel>
            <TextField/>
            <TextField/>
            <Button>Login</Button>
        </LoginPanel>
    );
}

const LoginPanel = styled.div`
    width: 200px;
`;

const TextField = styled.input`
height: 22px;
padding: 5px;
border: 2px solid #4de0d9;
margin-top: 5px;
`;

const Button = styled.button`
    display: inline-block;
    height: 30px;
    background: #4de0d9;
    border-radius: 4px;
    border: none;
    margin-top: 5px;
    width: 181px;

    &:hover {
      opacity: 0.8;
    }
`;
